Definition w8_div21 a1 a2 b :=
 let (q,s) := w8_div_wB a1 b in
 match w8_add_c s a2 with
 | C0 r =>
   match w8_compare r b with
   | Eq => (w8_carry_succ_c q, OOOOOOOO)
   | Lt => (q, r)
   | Gt => (w8_carry_succ_c q, w8_sub r b)
   end
 | C1 r =>
   let q := w8_carry_succ_c q in
   let r' := w8_sub r b in
   match w8_compare r' b with
   | Eq => (w8_carry_succ_c q, OOOOOOOO)
   | Lt => (q, r')
   | Gt => (w8_carry_succ_c q, w8_sub r' b)
   end
 end.

